const styles = theme => ({
  textField: {
    marginLeft: 30,
    marginRight: 100,
  },
  button: {
    marginTop: 20,
    marginRight: 30
  },
  imgCard: {
    width: 200,
    height: 200,
    marginLeft: 150
  },
  ml: {
    marginLeft: 20
  },
  justContent: {
    justifyContent: 'center'
  },
});

export default styles;
